import React from "react";
import './style.css';

const Login = () => {
  return (
    <div className="add-edit">
      <form
        className="add-edit__form"
      >
        <label>Veículo:</label>
        <input
          type="text"
          placeholder=""
        />

        <label>Ano:</label>
        <input
          type="number"
          id="ano"
          name="ano"
          placeholder=""
        />
        <input type="submit"/>
      </form>
    </div>
  );
};

export default Login;
